B.x2=new A.kF("Design thinking","is able to design and architect complex software systems, taking into account scalability, reliability, and maintainability. ","focus on design thinking",250,null)
B.x7=new A.jk("At work",!1,"The Master is self-reliant and dependable at work. They may be \u201ctough to crack\u201d and opinionated, so it is no surprise they often find themselves roles that value domineering types. In a leadership position, they will be in control, generous, and fair. The Master can see the bigger picture and will act decisively. They always take care to appear strong and set a decisive tone for the team. As a team member, the Master is hardworking and assertive, standing up for team members when needed. They often find it difficult, however, to know when to let go of control and allow others to lead. Moreover, they will not always carefully listen to what others may have to contribute.",B.b1,"",null)
B.F5=A.a(s(["Allow them to work independently, with little control, to maximize their skills.","Look for opportunities where their fearlessness and protective nature can be directed toward a clear goal, such as advocating for the team with leadership or in company meetings.","Use validation and express appreciation for their work while maintaining firm boundaries so as not to be manipulated or dominated by them.Look beyond their domineering attitude to recognize the ideas and feelings at the core of what they are saying."]),t.s)
B.x8=new A.jk("To help the",!0,"",B.F5," achieve their potential at work",null)
B.x9=new A.jk("The best attributes of a",!0,"Strong and heroic, the Master exudes confidence and trust. They thrive in situations where they can show off their strength and abilities to protect and care for others. Independent and industrious, they are not afraid to act on their beliefs or go ahead with their plans despite others\u2019 opinions. They excel in making fair and logical decisions.",B.b1,"",null)
B.EI=A.a(s(["Look beyond their domineering attitude to recognize the ideas and feelings at the core of what they are saying.","Avoid using an argumentative style or direct criticism, as these independent individuals are not afraid to speak their minds and take on a defensive approach if they feel like they are being attacked or depreciated.","Be direct and assertive, even when letting them know if certain decisions are impossible or if their behavior has been hurtful to others."]),t.s)
B.xa=new A.jk("Tips for more communicating and working with a",!0,"",B.EI,"",null)
B.lx=new A.jk("The main challenges of a",!0,"As they avoid even the possibility of showing weakness and vulnerability, Masters can have issues with their temper, resulting in outbursts and confrontations. Their domineering approach can seem egocentric and difficult for others to relate to. Despite their apparent strength, they can easily get hurt and feel rejected, and be unable to verbalize these feelings. Ultimately, this can lead them to bottle up their feelings until they eventually explode.",B.b1,"",null)
B.Ek=A.a(s(["Often turning to defensiveness or anger as a coping strategy, Masters may need coaching to take comments less personally and to more effectively express feelings of hurt.","Masters may benefit from coaching to help see that acknowledging emotions is not a sign of weakness but can actually be a sign of strength and can also help build a stronger team. Modeling this behavior will also help them adopt it.","They may need help in making space for and respecting others\u2019 opinions"]),t.s)
B.xb=new A.jk("Possible coaching points:",!1,"",B.Ek,"",null)
